I – o reconhecimento da organização social, dos
costumes, das línguas e das tradições indígenas;
II – o respeito às especificidades culturais de cada
comunidade indígena e aos respectivos meios de vida,
independentemente de seus graus de interação com o s demais
membros da sociedade;
III – a liberdade, especialmente de consciência, de
crença e de exercício de qualquer trabalho, pro fissão ou
atividade econômica;
IV – a igualdade material;
V – a imprescritibilidade, a inalienabilidade e a
indisponibi lidade dos direitos indígenas.

